import './App.css';

function App() {
  const users=[
    {name: "sajith", age:25},
    {name: "john", age: 24},
    {name: "lucas", age: 22},
  ];
  return(
    <div className="App">
      {users.map((name,key) =>{
        return <h1 key={key}>{name}</h1>;
      })}
    </div>
  ); 



}




export default App;
